","keccak256":"0xf0fead883840f8bd0fc6b330c890617e9b5c29dbcd3a5ee19057a1b206050c95","license":"MIT"},"contracts/Game.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import {BytesUtils} from "@ensdomains/ens-contracts/contracts/wrapper/BytesUtils.sol";

import {ERC721} from "@openzeppelin/contracts/token/ERC721/ERC721.sol";

import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";

import {ERC6551AccountLib} from "./library/ERC6551AccountLib.sol";

import {Errors} from "./Errors.sol";

import {IERC1155Receiver, IERC6551Registry, IENSResolver, INameWrapper, IERC165} from "./interfaces/interfaces.sol";

abstract contract Game is IERC1155Receiver, Ownable, ERC721, Errors {
    INameWrapper public immutable NAME_WRAPPER;
    IENSResolver public immutable PUBLIC_RESOLVER;

    bytes32 internal constant ZERO_SALT = bytes32(0);

    uint256 CHAIN_ID = block.chainid;

    IERC6551Registry public ERC6551Registry;
    address public ERC6551Implementation;

    uint256 public baseGamingENSTokenID;
    bytes32 public baseGamingENSNode;

    mapping(bytes32 => mapping(address => bool)) isTokenOwner;

    mapping(bytes32 => mapping(address => bytes32)) internal tokenToOwnerOfTokenNode;


    constructor(
        address _nameWrapper,
        address _publicResolver,
        address _ERC6551Registry,
        address _ERC6551Implementation,
        string memory _name,
        string memory _symbol
    ) ERC721(_name, _symbol) {
        NAME_WRAPPER = INameWrapper(_nameWrapper);
        PUBLIC_RESOLVER = IENSResolver(_publicResolver);
        ERC6551Registry = IERC6551Registry(_ERC6551Registry);
        ERC6551Implementation = _ERC6551Implementation;
    }

    function createSubNode(
        bytes32 node,
        string memory subNode
    ) internal returns (bytes32 newSubNode) {
        newSubNode = NAME_WRAPPER.setSubnodeRecord(
            // Gaming character subnode
            node,
            // Character tokenID as sub.subdomain to the gaming character subdomain
            subNode,
            // Owner
            address(this),
            // Resolver
            address(PUBLIC_RESOLVER),
            // TTL
            0,
            // Fuses
            0,
            // EXPIRY
            0
        );
    }

    function updateERC6551Contracts(
        address _ERC6551Registry,
        address _ERC6551Implementation
    ) external onlyOwner {
        ERC6551Registry = IERC6551Registry(_ERC6551Registry);
        ERC6551Implementation = _ERC6551Implementation;
    }

    function getParentNode(bytes memory name) internal pure returns (bytes32) {
        (, uint256 offset) = BytesUtils.readLabel(name, 0);
        bytes32 parentNode = BytesUtils.namehash(name, offset);
        return parentNode;
    }

    function onERC1155Received(
        address,
        address /* from */,
        uint256 tokenId,
        uint256 value,
        bytes calldata
    ) external returns (bytes4) {
        if (msg.sender != address(NAME_WRAPPER)) {
            revert InvalidTokenSender();
        }
        if (value != 1) {
            revert InvalidTokenAmount();
        }

        if (baseGamingENSTokenID == 0) {
            baseGamingENSTokenID = tokenId;
            baseGamingENSNode = bytes32(tokenId);
        }

        return IERC1155Receiver.onERC1155Received.selector;
    }

    function onERC1155BatchReceived(
        address,
        address,
        uint256[] calldata,
        uint256[] calldata,
        bytes calldata
    ) external pure returns (bytes4) {
        revert();
    }

    function supportsInterface(
        bytes4 interfaceId
    ) public pure override(ERC721, IERC165) returns (bool) {
        return interfaceId == type(IERC1155Receiver).interfaceId;
    }
    // Make the possibility to transfer an ERC721 token to the ERC6551 contract that is owned by the owner of the ERC721 token
    function checkTransferAllowance(
        address _account,
        uint256 _tokenId
    ) internal view returns (bool) {
        // invalid bytecode size then is not a ERC6551
        // It will be either an EOA address or a contract address not the ERC6551 proxy contract then allow the transfer
        if (_account.code.length != 0xAD) return true;
        // Getting the Proxy implementation of the ERC6551
        address _implementation = ERC6551AccountLib.implementation(_account);
        // implementation does not exist then is not a ERC6551 catching the
        // rare case that the contract above had the same bytecode as the ERC6551 proxy allow only EOA addresses because the have no code size
        if (_implementation.code.length == 0) return true;
        // invalid implementation then is maybe a ERC6551 but not the implementation that we expect
        if (_implementation != ERC6551Implementation) return false;
        // Getting the deployment params of the ERC6551

        (
            ,
            ,
            /* bytes32  _salt */ /* uint256  chainId */ address tokenContract,
            uint256 tokenId
        ) = ERC6551AccountLib.context(_account);
        // If the token ERC721 is not from this contract then allow the transfer
        if (tokenContract != address(this)) return true;
        // If the token ERC721 is not the one that the ERC6551 is wrapping then allow the transfer
        if (tokenId != _tokenId) return true;

        return true;
    }

    function isAllowedToMintAsset(
        bytes32 assetNode
    ) internal view returns (bool) {
        address account = msg.sender;
        // invalid bytecode size
        if (account.code.length != 0xAD) return false;
        address _implementation = ERC6551AccountLib.implementation(account);
        // implementation does not exist
        if (_implementation.code.length == 0) return false;
        // invalid implementation
        if (_implementation != ERC6551Implementation) return false;
        (
            ,
            ,
            /* bytes32  _salt */ /*uint256  chainId */ address tokenContract,
            uint256 tokenId
        ) = ERC6551AccountLib.context(account);

        bytes32 parentNode = getParentNode(
            NAME_WRAPPER.names(bytes32(tokenId))
        );

        bytes32 expectedParentNode = getParentNode(
            NAME_WRAPPER.names(assetNode)
        );

        return
            account ==
            ERC6551AccountLib.computeAddress(
                address(ERC6551Registry),
                ERC6551Implementation,
                ZERO_SALT,
                CHAIN_ID,
                tokenContract,
                tokenId
            ) &&
            parentNode == expectedParentNode &&
            tokenContract == address(this);
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    ) public override {
        if (!checkTransferAllowance(from, tokenId)) {
            revert CannotTransferToTokenERC6551();
        }
        // Explicitly update the isTokenOwner mapping
        isTokenOwner[bytes32(tokenId)][to] = true;
        isTokenOwner[bytes32(tokenId)][from] = false;

        super.safeTransferFrom(from, to, tokenId, data);
    }

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public override {
        if (!checkTransferAllowance(from, tokenId)) {
            revert CannotTransferToTokenERC6551();
        }
        // Explicitly update the isTokenOwner mapping
        isTokenOwner[bytes32(tokenId)][to] = true;
        isTokenOwner[bytes32(tokenId)][from] = false;

        super.transferFrom(from, to, tokenId);
    }
}
