pragma solidity ^0.8.20;

import {Strings} from "@openzeppelin/contracts/utils/Strings.sol";

import {Game} from "./Game.sol";

contract Tokemon is Game {
    enum TokenType {
        Character,
        Asset
    }

    struct Token {
        TokenType tokenType;
        string name;
        uint256 maxSupply;
        uint256 currentID;
        uint256 price;
    }

    mapping(bytes32 => Token) public tokens;

    mapping(bytes32 => bool) public decrypted;

    event TokenCreated(
        string name,
        bytes32 node,
        bytes32 parentNode,
        uint256 maxSupply,
        uint256 price,
        TokenType tokenType
    );

    event TokenMinted(
        bytes32 node,
        bytes32 parentNode,
        address account,
        TokenType tokenType
    );

    event Decrypted(bytes32 node, address account);

    constructor(
        address _nameWrapper,
        address _publicResolver,
        address _ERC6551Registry,
        address _ERC6551Implementation,
        string memory _name,
        string memory _symbol
    )
        Game(
            _nameWrapper,
            _publicResolver,
            _ERC6551Registry,
            _ERC6551Implementation,
            _name,
            _symbol
        )
    {}

    function createCharacter(
        string memory _name,
        string memory _value,
        uint256 _maxSupply,
        uint256 _price
    ) external onlyOwner {
        bytes32 _newSubNodeCharacter = createSubNode(baseGamingENSNode, _name);

        PUBLIC_RESOLVER.setText(_newSubNodeCharacter, "CID", _value);

        tokens[_newSubNodeCharacter] = Token({
            tokenType: TokenType.Character,
            name: _name,
            maxSupply: _maxSupply,
            currentID: 1,
            price: _price
        });

        emit TokenCreated(
            _name,
            _newSubNodeCharacter,
            baseGamingENSNode,
            _maxSupply,
            _price,
            TokenType.Character
        );
    }

    function createAsset(
        bytes32 assetForCharacterNode,
        string memory _name,
        string memory _value,
        uint256 _maxSupply,
        uint256 _price
    ) external onlyOwner {
        Token memory _token = tokens[assetForCharacterNode];
        if (_token.tokenType != TokenType.Character) revert InvalidTokenID();
        if (_token.currentID == 0) revert NonExistentToken();

        bytes32 _newSubNodeCharacterAsset = createSubNode(
            assetForCharacterNode,
            _name
        );

        PUBLIC_RESOLVER.setText(_newSubNodeCharacterAsset, "CID", _value);

        tokens[_newSubNodeCharacterAsset] = Token({
            tokenType: TokenType.Asset,
            name: _name,
            maxSupply: _maxSupply,
            currentID: 1,
            price: _price
        });

        emit TokenCreated(
            _name,
            _newSubNodeCharacterAsset,
            assetForCharacterNode,
            _maxSupply,
            _price,
            TokenType.Asset
        );
    }

    function mintCharacter(bytes32 _node) external payable {
        Token memory _token = tokens[_node];

        if (_token.tokenType != TokenType.Character) revert InvalidTokenID();

        uint256 _tokenId = _token.currentID;

        checkMintAllowance(_node, _tokenId);

        bytes32 _newCharacterNode = createSubNode(
            _node,
            Strings.toString(_tokenId)
        );

        uint256 _newCharacterTokenID = uint256(_newCharacterNode);

        _mint(msg.sender, _newCharacterTokenID);

        address _TBA = ERC6551Registry.createAccount(
            ERC6551Implementation,
            ZERO_SALT,
            CHAIN_ID,
            address(this),
            _newCharacterTokenID
        );

        tokenToOwnerOfTokenNode[_node][msg.sender] = _newCharacterNode;

        isTokenOwner[_node][msg.sender] = true;

        _token.currentID++;

        emit TokenMinted(_newCharacterNode, _node, _TBA, TokenType.Character);
    }

    // MAKE THE ASSETS BE LIKE ASETNAME.CHARIZARD.GAME.ETH
    // WHEN SOMEONE MINTS ONE WE REQUIRE ONLY THE TBA TOKEN TO BE ABLE TO MINT THE ASSET
    // TO DO THAT WE NEED TO CHECK THAT THE SENDER IS A TBA AND THAT TBA IS FROM A TOKEN ID SUCH AS
    // X.CHARIZARD.GAME.ETH
    // WE CAN DO THAT BY CHECKING THAT THE NODE THE TBA WHANTS TO MINT COMES FROM  CHARIZARD AND THAT THE
    // ASSET IS FROM THE CHARIZARD.GAME.ETH DOMAIN
    function mintAsset(bytes32 _node) external payable {
        Token memory _token = tokens[_node];

        if (_token.tokenType != TokenType.Asset) revert InvalidTokenID();

        if (isAllowedToMintAsset(_node)) {
            revert OnlyTBAsThatOwnTheCharacterForThatAsset();
        }

        uint256 _tokenId = _token.currentID;

        checkMintAllowance(_node, _tokenId);

        bytes32 _newAssetNode = createSubNode(
            _node,
            Strings.toString(_tokenId)
        );

        uint256 _newAssetTokenID = uint256(_newAssetNode);

        _mint(msg.sender, _newAssetTokenID);

        isTokenOwner[_node][msg.sender] = true;

        _token.currentID++;

        emit TokenMinted(_newAssetNode, _node, address(0), TokenType.Asset);
    }

    function checkMintAllowance(
        bytes32 _node,
        uint256 _CurrentTokenId
    ) internal view {
        // Insufficient funds
        if (msg.value < tokens[_node].price) {
            revert InsufficientFunds();
        }

        // Only one token per address
        if (isTokenOwner[_node][msg.sender]) {
            revert MaxOneTokenPerAddress();
        }
        // Non existent token
        if (_CurrentTokenId == 0) {
            revert NonExistentToken();
        }
        // All tokens currentID
        if (_CurrentTokenId > tokens[_node].maxSupply) {
            revert AllTokensMinted();
        }
    }

    function tokenURI(
        uint256 _tokenID
    ) public view override returns (string memory) {
        bytes32 _node = bytes32(_tokenID);

        bytes memory tokenName = NAME_WRAPPER.names(_node);

        bytes32 parentNode = getParentNode(tokenName);

        string memory _metadataCID = PUBLIC_RESOLVER.text(parentNode, "CID");

        return _metadataCID;
    }

    function decrypt(bytes32 _node) external {
        if (ownerOf(uint256(_node)) != msg.sender) revert NotTokenOwner();

        decrypted[_node] = true;

        emit Decrypted(_node, msg.sender);
    }

    function hasAccess(
        bytes32 _tokenNode,
        address _account
    ) external view returns (bool _hasAccess) {

        bytes32 tokenSubNode = tokenToOwnerOfTokenNode[_tokenNode][_account];

        if(tokenSubNode == bytes32(0)) return false;    

        _hasAccess =
            isTokenOwner[_tokenNode][_account] &&
            decrypted[tokenSubNode];
    }

    // NEEDS TO GET REMOVED ONLY FOR TESTING
    function transferDomain(address recipient) public onlyOwner {
        PUBLIC_RESOLVER.setAddr(baseGamingENSNode, recipient);
        NAME_WRAPPER.safeTransferFrom(
            address(this),
            recipient,
            baseGamingENSTokenID,
            1,
            ""
        );
    }
}
